import { makeStyles } from "@mui/styles";

export default makeStyles(() => ({
    root: {
        justifyContent: "center",
        alignItems: "center",
    },
    text: {
        padding: "2%",
    },
    button: {
        width: "70%",
        height: "100%",
    },
    textItem: {
        display: "flex",
        justifyContent: "center",
        textAlign: "center",
        alignItems: "center",

        height: "50%",
    },
    item: {
        padding: "5%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "20%",
    },
}));
